import React from "react";

const Nav = () => {
  return (
    <nav>
      <ul class="row">
        <li class="col s12 m4 l4 center">
          <a href="sass.html">Sass</a>
        </li>
        <li class="col s12 m4 l4 center">
          <a href="badges.html">Components</a>
        </li>
        <li class="col s12 m4 l4 center">
          <a href="collapsible.html">JavaScript</a>
        </li>
      </ul>
    </nav>
  );
};

export default Nav;
